import './Dishes.css';
import React, { useEffect, useState } from 'react';
import { fetchDishes, addDish, deleteDish } from '../api/api';

const Dishes = () => {
    const [dishes, setDishes] = useState([]);
    const [form, setForm] = useState({ name: '', ingredients: [{ id: '', grams: '' }] });

    useEffect(() => {
        fetchDishes().then(setDishes);
    }, []);

    const handleAddIngredient = () => {
        setForm({
            ...form,
            ingredients: [...form.ingredients, { id: '', grams: '' }]
        });
    };

    const handleInputChange = (index, field, value) => {
        const newIngredients = form.ingredients.slice();
        newIngredients[index][field] = value;
        setForm({ ...form, ingredients: newIngredients });
    };

    const handleSubmit = async event => {
        event.preventDefault();
        const newDish = await addDish(form);
        setDishes([...dishes, newDish]);
        setForm({ name: '', ingredients: [{ id: '', grams: '' }] });
    };

    const handleDelete = async id => {
        await deleteDish(id);
        setDishes(dishes.filter(dish => dish.id !== id));
    };

    return (
        <div className="container">
            <h2>Страви</h2>
            <table>
                <thead>
                <tr>
                    <th>ID страви</th>
                    <th>Назва страви</th>
                    <th>Інгредієнти</th>
                    <th>Калорійність</th>
                    <th>Дії</th>
                </tr>
                </thead>
                <tbody>
                {dishes.map(dish => (
                    <tr key={dish.id}>
                        <td>{dish.id}</td>
                        <td>{dish.name}</td>
                        <td>
                            <ul>
                                {dish.dishIngredients.map(di => (
                                    <li key={di.ingredient.id}>
                                        {di.ingredient.name} - {di.grams} г
                                    </li>
                                ))}
                            </ul>
                        </td>
                        <td>{dish.dishIngredients.reduce((total, di) => total + (di.grams * di.ingredient.caloriesPerGram), 0)}</td>
                        <td>
                            <button onClick={() => handleDelete(dish.id)}>Видалити</button>
                        </td>
                    </tr>
                ))}
                </tbody>
            </table>

            <div className="form-section">
                <h3>Додати страву</h3>
                <form onSubmit={handleSubmit}>
                    <input
                        type="text"
                        name="name"
                        placeholder="Назва Страви"
                        value={form.name}
                        onChange={e => setForm({...form, name: e.target.value})}
                        required
                    />
                    <div>
                        {form.ingredients.map((ing, index) => (
                            <div key={index}>
                                <input
                                    type="number"
                                    placeholder="ID Інгредієнта"
                                    value={ing.id}
                                    onChange={e => handleInputChange(index, 'id', e.target.value)}
                                    required
                                />
                                <input
                                    type="number"
                                    placeholder="Грами"
                                    value={ing.grams}
                                    onChange={e => handleInputChange(index, 'grams', e.target.value)}
                                    required
                                />
                            </div>
                        ))}
                        <button type="button" onClick={handleAddIngredient}>Додати інгредієнт</button>
                    </div>
                    <button type="submit">Додати страву</button>
                </form>
            </div>
        </div>
    );
};

export default Dishes;
